import React from "react";
import { NavLink } from "react-router-dom";

const Home =()=>{
  return(
    <>
    <div className="mt-3 mx-auto">
      <NavLink className="success" to="/IPhone" >Sign Up</NavLink>
      <br></br>
      <NavLink className="btn-get-started mx-auto" to="/IPhone" >Login</NavLink>
    </div>
    </>
      );
};

export default Home;
